tower_long = np.array(tower_long)

plt.style.use('seaborn-darkgrid')

def stat_plot(y_data, filepath, title):
    
    for i in range(0, len(sites)):
        plt.scatter(tower_long[i], y_data[i], color = '#1f78b4')
        plt.text(tower_long[i]+0.6,
                 y_data[i] + statistics.mean(y_data) * 0.05, 
                 sites[i]['name'], fontsize=9, zorder = 6)
                    
    plt.title('{} at flux towers by longitude'.format(title))
    plt.xlabel('Longitude of flux tower, in degrees')
    plt.ylabel('{} in mm/8-day period'.format(title))
    
    slope, intercept, r_value, p_value, std_err = scipy.stats.linregress(tower_long, y_data)
    line = slope * tower_long + intercept
    print(p_value)
    
    r_value, p_value = scipy.stats.pearsonr(tower_long, y_data)
    
    plt.plot(tower_long, line, 'r', zorder = 5,
             label='R = {:.2f}, P = {:.2f}'.format(r_value, p_value),
             color = '#33a02c', linewidth = 2.5)
    
    plt.legend()         
    plt.savefig(filepath, dpi = 350)
    plt.show()

